import HomePage from "./core/components/HomePage/HomePage";
import TypePage from "./core/components/TypePage/TypePage";
import PostPage from "./core/components/PostPage/PostPage";
import SigninPage from "./core/components/SigninPage/SigninPage";
import SignupPage from "./core/components/SignupPage/SignupPage";
import LandlordRegisterPage from "./core/components/LandlordRegisterPage/LandlordRegisterPage";
import PostDetailPage from "./core/components/PostDetailPage/PostDetailPage";
import ManagePage from "./core/components/ManagePage/ManagePage"
import { Switch, Route, Redirect } from 'react-router-dom';
import { useContext } from "react"
import AuthContext from "./store/auth-context";

function App() {
  const authCtx = useContext(AuthContext)

  return (
    <Switch>
      <Route path='/' exact>
        <HomePage />
      </Route>
      <Route path='/type'>
        <TypePage />
      </Route>
      <Route path='/post'>
        <PostPage />
      </Route>
      {!authCtx.isLoggedIn && 
        <Route path='/signin'>
          <SigninPage />
        </Route>}
      {!authCtx.isLoggedIn && 
        <Route path='/signup'>
          <SignupPage />
        </Route>}
      {authCtx.isLoggedIn && 
        <Route path='/manage'>
          <ManagePage />
        </Route>}
      {authCtx.isLoggedIn && 
        <Route path='/landlord-register'>
          <LandlordRegisterPage />
        </Route>}
      <Route path='*'>
        <Redirect to='/'/>
      </Route>
    </Switch>
  );
}

export default App;
